$(document).ready(function(){
	$(".popup input#user_name1").focusin(function(){if($(this).val()=='Введите имя'){$(this).val('')}});
	$(".popup input#user_name1").focusout(function(){if($(this).val()==''){$(this).val('Введите имя')}});
	$(".popup input#user_phone1").focusin(function(){if($(this).val()=='Введите телефон'){$(this).val('')}});
	$(".popup input#user_phone1").focusout(function(){if($(this).val()==''){$(this).val('Введите телефон')}});
	

	$("footer .form input#uname").focusin(function(){if($(this).val()=='Ваше имя'){$(this).val('')}});
	$("footer .form input#uname").focusout(function(){if($(this).val()==''){$(this).val('Ваше имя')}});
	$("footer .form input#uphone").focusin(function(){if($(this).val()=='Контактный телефон'){$(this).val('')}});
	$("footer .form input#uphone").focusout(function(){if($(this).val()==''){$(this).val('Контактный телефон')}});
	$("footer .form input#umail").focusin(function(){if($(this).val()=='Ваш E-Mail'){$(this).val('')}});
	$("footer .form input#umail").focusout(function(){if($(this).val()==''){$(this).val('Ваш E-Mail')}});
	$("footer .form textarea#utext").focusin(function(){if($(this).val()=='Ваше сообщение'){$(this).val('')}});
	$("footer .form textarea#utext").focusout(function(){if($(this).val()==''){$(this).val('Ваше сообщение')}});
	$("section.slider .form input#uname").focusin(function(){if($(this).val()=='Ваше имя *'){$(this).val('')}});
	$("section.slider .form input#uname").focusout(function(){if($(this).val()==''){$(this).val('Ваше имя *')}});
	$("section.slider .form input#uphone").focusin(function(){if($(this).val()=='Ваш телефон *'){$(this).val('')}});
	$("section.slider .form input#uphone").focusout(function(){if($(this).val()==''){$(this).val('Ваш телефон *')}});
	$("section.slider .form input#umail").focusin(function(){if($(this).val()=='Ваш E-Mail *'){$(this).val('')}});
	$("section.slider .form input#umail").focusout(function(){if($(this).val()==''){$(this).val('Ваш E-Mail *')}});
	$("section.slider .form textarea").focusin(function(){if($(this).val()=='Ваше сообщение'){$(this).val('')}});
	$("section.slider .form textarea").focusout(function(){if($(this).val()==''){$(this).val('Ваше сообщение')}});
	$('section.portfolio #gallery_carousel').carouFredSel({width:948,height:139,prev:'#prev',next:'#next',auto:false,mousewheel:true,swipe:{onMouse:true,onTouch:true}});
	$('#scrollbarX').tinyscrollbar({size: 596, sizethumb: 30,axis: 'x'}); 
	
	var set_slide = function(selector, slide) {
		$(selector).each(function() {
			var position = slide*400+300;
			var block = $(this);
			var shift = function() {
				block.css('background-position', '0 '+position+'px');
				position -= 100;
			}
			setTimeout(shift, 60);
			setTimeout(shift, 120);
			setTimeout(shift, 180);
			setTimeout(shift, 240);
		});
	}	
	
	var time = new Date();
	var target_time = new Date(time.getFullYear(), time.getMonth(), time.getDate());
	target_time = target_time.valueOf()+1000*60*60*24;
	var tick = function(init) {
		if (init == undefined) {
			init = false;
		}
		var current_time = new Date();
		current_time = current_time.valueOf();
		if (current_time > target_time) {
			var time = new Date();
			target_time = new Date(time.getFullYear(), time.getMonth(), time.getDate());
			target_time = target_time.valueOf()+1000*60*60*24;    		
		}
		var time_diff = Math.floor((target_time - current_time)/1000);	
		var second_2 = time_diff % 10; time_diff = Math.floor(time_diff/10);
		var second_1 = time_diff % 6; time_diff = Math.floor(time_diff/6);
		var minute_2 = time_diff % 10; time_diff = Math.floor(time_diff/10);
		var minute_1 = time_diff % 6; time_diff = Math.floor(time_diff/6);
		var hour_2 = Math.floor(time_diff/10);
		var hour_1 = time_diff % 10;
		set_slide('div.secondPlay', second_2);
		if ((second_2 == 9) || init) {set_slide('div.second6Play', second_1);
		if ((second_1 == 5) || init) {set_slide('div.minutePlay', minute_2);
		if ((minute_2 == 9) || init) {set_slide('div.minute6Play', minute_1);
		if ((minute_1 == 5) || init) {set_slide('div.hourPlay', hour_1);
		if ((hour_2 == 9) || init) {set_slide('div.hour2Play', hour_2);}}}}}
	  }
	tick(true);
	setInterval(tick, 1000);
	$(".slider .coundown .in .order-btn").click(function(){
		$("aside > .in input[name=uname]").focus();
		$('body,html').animate({scrollTop:565},800);
	});
	$("footer .form input[type=button],section.slider .form input[type=button]").click(function(){
		var message = {};
		var me = $(this);
		message.name = $(this).parent().find("input.uname").val();
		message.phone = $(this).parent().find("input.uphone").val();
		message.mail = $(this).parent().find("input.umail").val();
		message.text = $(this).parent().find("textarea").val();
		$(this).parent().find("input.uname").css('box-shadow', 'none');
		$(this).parent().find("input.uphone").css('box-shadow', 'none');
		$(this).parent().find("input.umail").css('box-shadow', 'none');
		$(this).parent().find("textarea").css('box-shadow', 'none');
		$.ajax({
			type: 'POST',
			url: 'class.ajax.php',
			data: {
				'message':message,
				'action':'extend'
			}, success: function(result){
				if(result.name == 1){
					$(me).parent().find("input.uname").css('box-shadow', 'inset 0px 0px 3px #ff0000');
				}
				if(result.phone == 1){
					$(me).parent().find("input.uphone").css('box-shadow', 'inset 0px 0px 3px #ff0000');
				}
				if(result.mail == 1 || result.mail == 2){
					$(me).parent().find("input.umail").css('box-shadow', 'inset 0px 0px 3px #ff0000');
				}
				if(result.text == 1){
					$(me).parent().find("textarea").css('box-shadow', 'inset 0px 0px 3px #ff0000');
				}
				if(result.name != 1 && result.mail != 1 && result.mail != 2 && result.text != 1){
					$(me).parent().find("input.uname").css('box-shadow', 'none');
					$(me).parent().find("input.uphone").css('box-shadow', 'none');
					$(me).parent().find("input.umail").css('box-shadow', 'none');
					$(me).parent().find("textarea").css('box-shadow', 'none');
					if(result == 'true'){
						$(me).parent().find("input.uname").val('Ваше имя *');
						$(me).parent().find("input.uphone").val('Ваш телефон *');
						$(me).parent().find("input.umail").val('Ваш E-Mail *');
						$(me).parent().find("textarea").val('Ваше сообщение');
						alert('Письмо успешно отправлено');
					}
				}
			},
			dataType: 'json'
		});
	});
	$(".popup .submit input").click(function(){
		var message = {};
		var me = $(this);
		message.name = $(this).parent().parent().find("input#user_name1").val();
		message.phone = $(this).parent().parent().find("input#user_phone1").val();
		$(this).parent().parent().find("input#user_name1").css('box-shadow', 'none');
		$(this).parent().parent().find("input#user_phone1").css('box-shadow', 'none');
		$.ajax({
			type: 'POST',
			url: 'class.ajax.php',
			data: {
				'message':message,
				'action':'orderphone'
			}, success: function(result){
				if(result.name == 1){
					$(me).parent().parent().find("input#user_name1").css('box-shadow', 'inset 0px 0px 3px #ff0000');
				}
				if(result.phone == 1){
					$(me).parent().parent().find("input#user_phone1").css('box-shadow', 'inset 0px 0px 3px #ff0000');
				}
				if(result.name != 1 && result.phone != 1){
					$(me).parent().parent().find("input#user_name1").css('box-shadow', 'none');
					$(me).parent().parent().find("input#user_phone1").css('box-shadow', 'none');
					if(result == 'true'){
						$(me).parent().parent().find("input#user_name1").val('Ваше имя *');
						$(me).parent().parent().find("input#user_phone1").val('Ваш телефон *');
						alert('Запрс успешно отправлен');
					}
				}
			},
			dataType: 'json'
		});
	});
	
	$("header .phones .order-button").click(function(){
		$(".popup,.fog").fadeIn();
		return false;
	});
	
	$(".popup .close,.fog").click(function(){
		$(".popup,.fog").fadeOut();
	});
	
});

